import React from 'react';

class Brochure extends React.Component{
    constructor(props){
        super(props)
      }
      render() {
        return(
            <div className="brochure">
                <h3>{this.props.username}</h3>
                <img src={this.props.img_name} />
                <a><i class="far fa-heart"></i></a>
            </div>
            );
        }   
    }
export default Brochure;
